package com.vitorpamplona.amethyst.commons.robohash

import android.util.Log
import com.vitorpamplona.quartz.crypto.CryptoUtils
import com.vitorpamplona.quartz.encoders.Hex
import com.vitorpamplona.quartz.encoders.HexValidator

object Robohash {
    private fun encodeColor(
        r: Int,
        g: Int,
        b: Int,
    ): String {
        return String(
            CharArray(7) {
                when (it) {
                    0 -> '#'
                    1 -> Hex.hexCode[(r shr 4) and 0xF]
                    2 -> Hex.hexCode[r and 0xF]
                    3 -> Hex.hexCode[(g shr 4) and 0xF]
                    4 -> Hex.hexCode[g and 0xF]
                    5 -> Hex.hexCode[(b shr 4) and 0xF]
                    6 -> Hex.hexCode[b and 0xF]
                    else -> ' '
                }
            },
        )
    }

    private fun byteMod10(byte: Byte): Int {
        return byte.toUByte().toInt() % 10
    }

    private fun reduce(
        start: Int,
        channel: Byte,
    ) = (start + (channel.toUByte().toInt() * 0.3906f)).toInt()

    private fun bytesToRGB(
        r: Byte,
        g: Byte,
        b: Byte,
        makeLight: Boolean,
    ): String {
        return if (makeLight) {
            // > 150-256 color channels
            encodeColor(reduce(150, r), reduce(150, g), reduce(150, b))
        } else {
            // < 50-100 color channels
            encodeColor(reduce(50, r), reduce(50, g), reduce(50, b))
        }
    }

    fun assemble(
        msg: String,
        isLightTheme: Boolean,
    ): String {
        val hash =
            if (HexValidator.isHex(msg)) {
                Hex.decode(msg)
            } else {
                Log.w("Robohash", "$msg is not a hex")
                CryptoUtils.sha256(msg.toByteArray())
            }

        val bgColor = bytesToRGB(hash[0], hash[1], hash[2], isLightTheme)
        val fgColor = bytesToRGB(hash[3], hash[4], hash[5], !isLightTheme)
        val body = bodies[byteMod10(hash[6])]
        val face = faces[byteMod10(hash[7])]
        val eye = eyes[byteMod10(hash[8])]
        val mouth = mouths[byteMod10(hash[9])]
        val accessory = accessories[byteMod10(hash[10])]

        val capacity =
            HEADER.length +
                74 +
                body.style.length +
                body.paths.length +
                face.style.length +
                face.paths.length +
                eye.style.length +
                eye.paths.length +
                mouth.style.length +
                mouth.paths.length +
                accessory.style.length +
                accessory.paths.length +
                MID.length +
                BACKGROUND.length +
                END.length

        val result =
            buildString(capacity) {
                append(HEADER)

                append(".cls-bg{fill:")
                append(bgColor)
                append(";}.cls-fill-1{fill:")
                append(fgColor)
                append(";}.cls-fill-2{fill:")
                append(fgColor)
                append(";}")

                append(body.style)
                append(face.style)
                append(eye.style)
                append(mouth.style)
                append(accessory.style)

                append(MID)

                append(BACKGROUND)
                append(body.paths)
                append(face.paths)
                append(eye.paths)
                append(mouth.paths)
                append(accessory.paths)

                append(END)
            }

        check(result.length == capacity) { "${result.length} was different from $capacity" }

        return result
    }

    private data class Part(val style: String, val paths: String)

